import React from 'react';
import './App.css'; 

function Navbar() {
  return (
    <nav className="navbar">
      <a className="navbar-link" href="/">
        Home
      </a>
      <a className="navbar-link" href="/search">
        Search
      </a>
      
    </nav>
  );
}

export default Navbar;
